import { Card, Space } from "antd";

function TestCard({ networkDetailObject }) {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title={
          <div>
            <b>SSID: </b>
            {networkDetailObject.ssid}
          </div>
        }
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <Space size={16}>
          <p>Network Status:</p>{" "}
          <p style={{ color: "#45d5c9" }}>
            <b>{networkDetailObject.network_status}</b>
          </p>
        </Space>
        <Space size={21}>
          <p>Protocol Type:</p>{" "}
          <p>
            <b>{networkDetailObject.wireless_standard}</b>
          </p>
        </Space>
        <Space size={22}>
          <p>Security Type:</p>{" "}
          <p>
            <b>{networkDetailObject.wireless_protocol}</b>
          </p>
        </Space>
        <Space size={14}>
          <p>IPv4 DNS Server</p>{" "}
          <p>
            <b>{networkDetailObject.default_gateway}</b>
          </p>
        </Space>
      </Card>
    </div>
  );
}

export default TestCard;
